import classes from "./EventItem.module.css";
import Card from "../ui/Card";
import { useHistory } from "react-router-dom";
import { useState } from "react";

function EventItem(props) {

  const history = useHistory();
  const [addFightForEvent, setAddFightForEvent] = useState(false);


  const addFight = () => {
    console.log("addFight")
    setAddFightForEvent(true);
    // history.push('/new-fight');
    history.push({
      pathname: '/new-fight',
        state: "Ide gas" // your data array of objects
    })
  }
  
  return (
    <li className={classes.item}>
      <Card>
        <div className={classes.content}>
          <h3>{props.name}</h3>
          <div className={classes.actions}>
            {/* {addFightForEvent ? <div>Ide gas</div> : <div>Ne ide gas</div>} */}
          <button onClick={addFight}>Add Fight For Event</button>
        </div>
        </div>
      </Card>
    </li>
  );
}

export default EventItem;
